import React from "react";
import "./Product.css";

class Product extends React.Component {
  render() {
    return (
      <div className="product">
        <h1>Test Produkt</h1>
        <div class="content">
          <p>Artnr: 00000</p>
          <p id="price">999:99</p>
        </div>
      </div>
    );
  }
}

export default Product;
